import { computeHeadingLevel } from "@testing-library/react";
import { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
// import { useQuery, useQueryClient } from "react-query";
import API from "../API";
import { SideNavBar } from "../components";

function ViewModel() {
  const [modelResults, setModelResults] = useState({});
  const [selectCustomer, setSelectCustomerState] = useState();
  const location = useLocation();
  const viewModel = [];

  // console.log("DATA");
  // console.log(modelResults.data.data);

  // const queryClient = useQueryClient();

  const filterView = () => {
    modelResults.filter((v) => {
      v.customer.id === selectCustomer
        ? viewModel.push(v)
        : console.log(v + " not a view model");
    });

    console.log(viewModel);
  };

  useEffect(async () => {
    await setSelectCustomerState(location.state.setCustomer);

    await API.getViewModel().then((res) => {
      setModelResults(res.data);
    });

    await filterView();

    console.log(location.state.setCustomer);
  }, []);

  return <></>;
}

export default ViewModel;
